      :root {
        --text-strong: #0d0d0d;

      }

      :root[data-theme="dark"] {
        color-scheme: dark;
        --text-strong: #fff;

        --page-primary: #0d0d0d;

      .type-hero {

      }

      }

        line-height: 32px;
        letter-spacing: -0.28px;
      }

      .text-primary {
        color: var(--text-primary);
      }

      .text-secondary {
        color: var(--text-secondary);
      }

        font-family: Roobert, sans-serif;
        margin: 0;
        padding: 0 1rem;
